INSERT INTO tbl_defectlogs VALUES ('112', 'con1617433298', 'เอ้', 'IPC', '49/218', '0985740638', 'rinphuengthong123@gmail.com', 'แจ้งซ่อมพื้นห้องน้ำ น้ำขังไม่ระบาย ชักโครกเอียง พื้นบัวประตูชำรุด พื้นห้องชั้นบน น้ำซีมขอบหน้าต่างห้อง สีเพดานข้างนอก ข้างในขอบขัวประตูชั้นล่าง รั้วประตูรถกะบะจอดเข้าในบ้านไม่ได้ แจ้งเจ้าหน้าที่ตั้งแต่เริ่มเข้ามาอยู่ 19มค2019. \r\n', '0000-00-00 00:00:00', '2021-04-03 02:01:38', '0000-00-00 00:00:00', '2021-05-19 10:49:28', 'แก้ไขเสร็จเรียบร้อย18/5/64', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '2021-05-05 10:47:56', '1', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('113', 'con1617433697', 'ธันยาภัทร์ ปานฉิม', 'IPC', '49/206', '0987951916', 'ohza09@gmail.com', '1.ระบบน้ำรั่ว \r\n2 น้ำรั่วซึมที่ผนัง (งานเดิมแก้ยังไม่แล้วเสร็จตั้งแต่ปี2020)', '0000-00-00 00:00:00', '2021-04-03 02:08:17', '0000-00-00 00:00:00', '2021-05-21 13:53:35', '-นัดหมายแจ้งกำหนดซ่อมก่อน เพราะลูกบ้านต้องการด่วน ในวันศุกร์14/5/64 เวลา 11.00 น.     \r\n-นัดซ่อมเก็บสีแก้ไขน้ำรั่วซึมผนังวันศุกร์14/5/64พร้อมเทสให้ลูกบ้าน ตรวจสอบอีกครั้ง และขอให้ดูจนกว่าจะหมดหน้าฝนถึงเดือนมิถุนายน ถ้าหลังมิถุนายน และเกิดความเสียหายลูกบ้านยินดีรับผิดชอบเอง (อยู่ระหว่างคุยกับผรม.) และวันเสาร์15/5/64 แก้ไขระบบท่อน้ำ12/5/64                                                                                                      วันจันทร์ 17/5/64 ผรมเข้าเทส อีกครั้ง ยังไม่เรียบร้อย  วันอังคาร 18/5/64 ผรม แก้ไขเรียบร้อยลูกค้าเซนต์เอกสาร                                                                                                        ', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '2021-05-14 11:00:00', '1', '', '0', null);
