INSERT INTO tbl_defectlogs VALUES ('121', 'con1617449496', 'อรุณี', 'IPC', '49/228', '0918066312', 'ne.arunee@gmail.com', '1.กำแพงโดยรอบสีบวม พุพอง\r\n2.ฝ่าเชิงชายหน้าบ้านแตกร้าว\r\n3. กระเบื้องพื้นมุมบันไดแตกร้าว\r\n4.ถังบำบัดตัวดักกากล้นออกไปทางท่อน้ำทิ้ง', '0000-00-00 00:00:00', '2021-04-03 06:31:36', '0000-00-00 00:00:00', '2021-05-19 10:57:58', '-แก้ไขเรียบร้อย 18/5/64', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '2021-05-05 10:56:21', '1', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('122', 'con1617458023', 'นายดำเนิน หมั่นดี', 'IPC', '49/241', '0944194524', 'noenpnt@hotmail.com', 'น้ำซึมหน้าต่างบานใหญ่ทำให้พื้นลามิเนตบวมน้ำชำรุด ห้องนอนมาสเตอร์รูม แจ้งซ่อมไปหลายครั้งแล้ว', '0000-00-00 00:00:00', '2021-04-03 08:53:43', '0000-00-00 00:00:00', '2021-05-27 11:59:07', '-เข้าตรวจสอบหน้างานเเล้ว 26/5/64 รอวิศวแจ้งเข้าซ่อม', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('123', 'con1617702222', 'วนิดา หลอดทองแดง', 'IPC', '49/221', '0968052223', 'Anusara_pu@hotmail.com', '1.น้ำซึมที่กระจกตรงบันได\r\n2.กาบบัวพอง\r\n3.กำแพงร้าวช่วงรอต่อภายในตัวบ้าน\r\n4.ชักโครกมีกลิ่นอัดขึ้นมาจากท่อที่ห้องนอนชั้นบน', '0000-00-00 00:00:00', '2021-04-06 04:43:42', '0000-00-00 00:00:00', '2021-05-27 11:57:45', '-เข้าตรวจหน้างานเเล้ว25/5/64 รอคิวซ่อม', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('124', 'con1617704262', 'ชาญวิทย์  เชื้อบ้านเกาะ', 'IPC', '49/34', '0840991585', 'chanwit-james@hotmail.com', '1.บริเวณชั้นล่าง ฝ้ามีน้ำรั่ว จนเป็นรอยคราบน้ำ\r\n2.ผนังด้านข้างบ้าน มีคราบน้ำซึม  (เคยแจ้งไปแล้ว)\r\n3.ช่องชาร์ปในห้องน้ำ ไม่ได้ก่อปิด (เคยแจ้งไปแล้ว)\r\n4.ปั้มน้ำ ทำงานตลอดเวลา', '0000-00-00 00:00:00', '2021-04-06 05:17:42', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '-', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('125', 'con1617960849', 'จิรณัชชา สมเสียง', 'IPC', '49/224', '0627478228', 'thitipong2536golf@gmail.com', 'บัวข้างบ้าน รื้อแล้วไม่มาทำ น้ำชึม\r\nฝ้าชั้นล่าง เป็นรอยบุพังจากห้องน้ำชั้น2\r\nห้องน้ำชั้นล่างฝ้ารั่วจากตัวบ้านด้านบน\r\nน้ำรั่วเข้าหน้าต่าง\r\nบาเก้ที่น้ำรั่วไหล บวมแตก\r\nไฟฟ้าขึ้นเกินหลายเท่า ไม่มั่นใจ ไฟลงกาวหรือป่าว\r\nอื่นๆอีกมากมาย', '0000-00-00 00:00:00', '2021-04-09 04:34:09', '0000-00-00 00:00:00', '2021-05-27 11:58:08', '-กำลังซ่อมอยู่ 27/5/64', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
