INSERT INTO tbl_defectlogs VALUES ('128', 'con1618806393', 'นาย วงศ์ไกร ดำรงค์รักษ์', 'IPC', '49/245', '0865055915', 'mayllbemayllbe@gmail.com', 'หน้าต่างหลังบ้านชั้น 2 2 ห้องฝนตกน้ำซึม พื้นเสีย\r\nบันไดน้ำซึมจากระเบียงเข้าข้างบ้าน บันไดเสีย\r\nกระจกหน้ามุมหน้าตัวบ้านน้ำซึมบัวเสีย\r\nชั้น 2 น้ำซึมจากกระจกข้างบ้าน\r\nข้างบ้านน้ำซึมจากกระจกบัวเสีย', '0000-00-00 00:00:00', '2021-04-19 11:26:33', '0000-00-00 00:00:00', '2021-05-27 12:02:56', '--รอตรวจสอบหน้างาน 27/5/64', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('129', 'con1618806573', 'นายวงศ์ไกร ดำรงค์รักษ์', 'IPC', '49/245', '0865055915', 'mayllbemayllbe@gmail.com', 'หลังบ้านหน้าต่างชั้น 2 2 ห้องน้ำซึม พื้นเสีย\r\nบันไดน้ำซึมจากระเบียงเข้าผนังข้างบ้าน บันไดเสีย\r\nกระจกมุมหน้าตัวบ้าน น้ำซึม บัวเสีย\r\nกระจกข้างตัวบ้านชั้น 2 น้ำซึม\r\nกระจกข้างตัวบ้าน น้ำซึม', '0000-00-00 00:00:00', '2021-04-19 11:29:33', '0000-00-00 00:00:00', '2021-05-27 12:03:10', '--รอตรวจสอบหน้างาน 27/5/64', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('130', 'con1619153283', 'ปิยธิดา ปั้นเปล่ง', 'IPC', '49/242', '0897670645', 'pae-naruk@hotmail.com', '1.น้ำรั่วซึมตรงบันได มีการแก้ไขแล้วแต่ไม่หาย\r\n2.เพดานห้องน้ำทั้ง 2 ห้อง เพดานพอง\r\n3.วงกบรอบบ้านพองหลุด\r\n4. ดินรอบๆบ้านทรุด\r\n5. ด้านล่างที่ตรงกับห้องน้ำด้านบนรั่วเก็บงานให้แล้วแต่เก็บไม่เรียบร้อยไม่มีทำให้ต่อ\r\n6. ด้านหลังไฟมีมาแก้ไขแต่เก็บงานไม่เรียบร้อย\r\nหมายเหตุ:เรื่องนี้แจ้งนาน 2ปีแล้วแต่ไม่มีใครมาแก้ไขให้บอกไม่มีช่าง', '0000-00-00 00:00:00', '2021-04-23 11:48:03', '0000-00-00 00:00:00', '2021-05-27 11:59:46', 'เข้าตรวจสอบหน้างานเเล้ว 26/5/64 รอวิศวแจ้งซ่อม', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('131', 'con1619153488', 'ปิยธิดา ปั้นเปล่ง', 'IPC', '49/242', '0897670645', 'pae-naruk@hotmail.com', '1.น้ำรั่วซึมตรงบันได(มีการแก้ไขแล้วแต่ไม่หายแล้วไม่มีการมาแก้ไขต่อ)\r\n2. เพดานห้องน้ำทั้ง 2 ห้องพอง และรอบๆบ้านข้างนอก ตรงรอยต่อพองรั่ว\r\n3. วงกบรอบบ้านพองหลุด\r\n4.ดินรอบบ้านทรุด\r\n5. ด้านล่างที่ตรงห้องน้ำด้านบนรั่ว(ได้มีการมาแก้ไขแล้วแต่เก็บงานไม่เรียบร้อย)\r\n6. ด้านหลังไฟมีการแก้ไข(แต่เก็บงานไม่เรียบร้อย)', '0000-00-00 00:00:00', '2021-04-23 11:51:28', '0000-00-00 00:00:00', '2021-05-27 12:00:41', '-ตรวจสอบหน้างานแล้ว26/5/64   รอวิศวเเจ้งซ่อม', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
