INSERT INTO tbl_defectlogs VALUES ('133', 'con1620457325', 'อมิตารัตน์ ศีระวัฒนปรีชา', 'IPC', '49/25', '0855587757', 'pang_eve@hotmail.com', 'ฝ้าเชิงชายสีหลุดล่อน อาจจะเกิดจากน้ำรั่วซึมบนหลังคา', '0000-00-00 00:00:00', '2021-05-08 02:02:05', '0000-00-00 00:00:00', '2021-05-21 13:56:32', '-แจ้งลูกบ้าน หมดการรับประกันแล้ว  จึงได้เเนะนำช่างให้ลูกบ้านโดยลูกบ้านต้องออกค่าใช้จ่ายเอง  และลูกบ้านรับทราบ จึงให้ช่างตรวจสอบหน้างานและประเมินราคาเพื่อแก้ไขต่อไป12/5/64   17/5/64 ผรมติดต่อลูกค้าโดยตรง ลูกบ้านรับทราบ', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('134', 'con1620461911', 'อมิตารัตน์ ศีระวัฒนปรีชา', 'IPC', '49/25', '0855587757', 'pang_eve@hotmail.com', 'ฝ้าเชิงชายหลังคาหลุดลอกร่อน ', '0000-00-00 00:00:00', '2021-05-08 03:18:31', '0000-00-00 00:00:00', '2021-05-10 16:26:58', '10/5/64 ได้ติดต่อกับลูกบ้านรับเรื่องรายงานเรียบร้อย ตรวจสอบสถานะโอน28/2/18 หมดการรับประกันผลงาน 28/2/19 รอแจ้งลูกบ้านพร้อมแนะนำช่าง ซึ่งอาจจะมีค่าใช้จ่ายที่ลูกบ้านออกค่าใช้จ่ายเอง', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('135', 'con1620548931', 'จิตตราภารณ์', 'IPC', '49/11', '0894901484', 'jittraporn@kbs.co.th', 'แจ้งพื้นบันใดเสียหาย1อัน บันใดพักขาด้านบน เนื่องจากถูกปลวกกิน1อัน ต้องการด่วน เพราะว่ารื้อบันใดออกไปแล้ว', '0000-00-00 00:00:00', '2021-05-09 03:28:51', '0000-00-00 00:00:00', '2021-05-18 11:05:17', '-ลูกบ้านแจ้งว่าเกิดจากปลวกกินในห้องน้ำรามมาถึงบันไดชั้น 2 ตรวจสอบแล้วโอน31/1/18 หมดรับประกันผลงาน 31/1/19 หมดการรับประกัน และได้แจ้งให้ลูกบ้านส่งรูปภาพมา รอเเจ้งลูกบ้านและเเนะนำช่างให้โดยลูกบ้านเสียค่าใช้จ่ายเอง  10/5/64\r\n 11/5/64 วิศวกร ได้เเจ้งกับลูกบ้านเเล้วว่าหมดการรับประกัน ลูกบ้านรับทราบ   และซ่อมเอง \r\n', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '', '0', null);
