INSERT INTO tbl_defectlogs VALUES ('139', 'con1621135000', 'ปัณฑ์รพล เจียนศิริจินดา', 'IPC', '49/217', null, null, '1.ปัญหาหลักๆ คือ ลูกบ้านเคยแจ้งซ่อมไปแล้วก่อนหน้านี้ มีการเข้าไปแก้ไขปัญหาน้ำรั่ว - น้ำซึม รอบบ้านแล้ว ไม่มีอาการรั่วซึมอีก แต่ ไม่มีช่างเข้าไปเก็บงาน เก็บสี จากการซ่อมครั้งที่แล้ว  รับแจ้ง 6/4/21 1.น้ำรั่ว น้ำซึม เคยแก้แล้วแต่ไม่มีช่างมา เก็บงาน 2.ช่างไม่มาเก็บงานรอบบ้าน + หูช้าง 3.ภายในเคยล๊อคระเบียงแต่ช่างไม่ติดบัวให้', '0000-00-00 00:00:00', '2021-04-06 09:15:57', '0000-00-00 00:00:00', '2021-05-19 13:53:06', 'แก้ไขเรียบร้อย 18/5/64', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '2021-05-05 13:53:06', '1', null, '0', null);
INSERT INTO tbl_defectlogs VALUES ('140', 'con1621137000', 'นายกฤตภาส สีใส', 'IPC', '49/247', '063-2249223', null, 'รับแจ้ง 20/4/63 *เคยแจ้งเรื่องกับคุณเก๋ไว้มีหลักฐานทางไลน์ตั้งแต่ปี61 1.บัวชั้น1 บวม *รื้อออกเฉยๆก็ได้ 2.น้ำซึมเวลาฝนตก 3.เบรกเกอร์เด้งไม่ทำงาน 4.บันไดมีเสียงดัง 5.หน้าต่างห้องนอนชั้น 2 ซึม 6.มีรอยแคร๊กห้องนอน ชั้น2 7.บัวชั้น2 และพื้นซึม เพราะฝนสาด 8.ประตูเลื่อนดินทรุด 9.งานภายนอกไม่ได้เก็บสี', '0000-00-00 00:00:00', '2021-04-20 09:15:57', '0000-00-00 00:00:00', '2021-05-27 12:03:20', '-รอตรวจสอบหน้างาน 27/5/64', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', null, '0', null, '0', null);
INSERT INTO tbl_defectlogs VALUES ('151', 'con1621569897', 'กิติพงษ์ เเห้วทอง', 'IPC', '49/38', '0930103525', 'tom9kitiphong@gmail.com', '1.มีรอยรั่วซึมของผนังรอบตัวบ้าน เวลามีฝนตกน้ำจะไหลตามผนังเหมือนน้ำตกเลยครับ \r\n2.บัวมีการบวมเเละชำรุดที่เกิดจากน้ำที่ซึมจากผนังบ้าน \r\n3. มีการซ้อมฟ่าไม่เสร็จ   เเละฟ่าหน้าบ้านมีรอยร้าว\r\n4.ปั้มน้ำรั่ว\r\n', '0000-00-00 00:00:00', '2021-05-21 11:04:57', '0000-00-00 00:00:00', '2021-05-27 12:03:45', '-รับเรื่องและประสานงานกับลูกบ้านรอตรวจสอบหน้างานค่ะ\r\n21/5/64  ตรวจสอบหน้างานแล้ว 27/5/64 รอคิวเเจ้งซ่อม', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('152', 'con1621744727', 'รัตน์นภา', 'ICO', '88/4', '0825519796', 'ratnapa.i2533@gmail.com', 'ตรวจความเรียบร้อยบ้าน วันที่ 23/5/64 \r\nพบปัญหา 4 จุดดังนี้\r\n1.หน้าต่างบานเลื่อนห้องเล็กฝั่งขวา : หลุดเฟรม, ฝืด, ไม่ล๊อก\r\n2.ประตูห้องนอนเล็ก : ขอบซิลิโคนหลุด สั้นไม่เสมอขอบ\r\n3.บันได 2ขั้น จากด้านบน : เดินลงมีเสียงดัง\r\n4.ประตูห้องน้ำชั้น 1 : ขอบประตูสีไม่เรียบ', '0000-00-00 00:00:00', '2021-05-23 11:38:47', '0000-00-00 00:00:00', '2021-06-07 15:11:58', 'เป็นงาน DF 2 ที่ยังแก้ไขไม่เสร็จ    เข้าแก้ไขงานเรียบร้อย 25/5/64 รอลคตรวจ  ลูกค้าเข้าตรวจวัน 30/5/64  และให้ช่างเเก้ไขเพิ่มเป็น DF4    ช่างเข้าแก้ไขประตูวันที่30/5/64 และช่างเข้าแก้ไขประตูวัน 3/6/64   แก้ไขเรียบร้อย 7/6/64 ', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '2021-05-25 11:52:57', '1', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('153', 'con1621834840', 'กรุณา ', 'IPC', '49/233', '0818566327', 'export6@rkifood.com', '1. ปลวกขึ้นบันไดบ้านนะคะ  จากเอกสารเริ่มทำสัญญาปี 2017 หมดอายุ 2020 แต่ช่างมาฉีดยังไม่ครบสัญญานะคะ  ยังเหลืออีกสองครั้งจะหมดเดือนต.ค. ปีนี้\r\n2. ดินทรุดตรงถังขยะที่รั้วนะคะ', '0000-00-00 00:00:00', '2021-05-24 12:40:40', '0000-00-00 00:00:00', '2021-05-24 13:15:32', '-รับเรื่อง 233 IPC  24/5/64  แจ้งลูกค้าหมดการรับประกัน เรื่องพื้นดินทรุดตัว และ เรื่องปลวก เเนะนำช่างให้ลูกบ้านยินดีออกค่าใช้จ่ายเองค่ะ\r\n', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '1', '', '0', null);
