INSERT INTO tbl_defectlogs VALUES ('155', 'con1621922668', 'ไพโรจน์ พงษ์เนตร', 'IPC', '49/248', '0955485435', 'pairojp@brewberry.co.th', '1.ปั้มน้ำดังถี่(น่าจะมีท่อรั่ว)ขอด่วนนะคับ\r\n2.บันไดขึ้นชั้น 2 ดังทุกขั้น\r\n3.หน้าต่างห้องนอนทั้ง 3 ห้องรั่ว\r\n4.หน้าต่างห้องเล็กปิดแต่ไม่สนิทมีช่องลมเข้าได้(คุณเก๋พาช่างมาดูช่างบอกต้องเปลี่ยนบานหน้าต่างใหม่)\r\n5. ช่องชาปหลังบ้านทางคุณเก๋เอาช่างมาเจาะเพื่อไล่หนูในฝ่าออกและทำกลับที่เดิมแล้วแต่หลังจากนั้นมีรอยแตกยังไม่มาซ่อมให้\r\n6. น้ำรั่วตรงกระจกบันไดทางขึ้นชั้น 2', '0000-00-00 00:00:00', '2021-05-25 01:04:28', '0000-00-00 00:00:00', '2021-05-27 12:04:35', '-รับเรื่องรอตรวจสอบ 27/5/64', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('156', 'con1622090884', 'นิติบุคคลอาคารชุด ดิไอริส บางใหญ่', 'IBY', '3710', '0648975422', 'theirisbangyai.jlm@gmail.com', 'เรียน  เจ้าหน้าที่หลังการขาย                                                                                                                                                          \r\n        เนื่องจากผนังด้านนอกของอาคาร  3  ชั้น 7  ติดนห้องเจ้าของร่วม 127/144  ทางนิติฯได้ตรวจสอบสาเหตุพบว่าห้องชุดมีน้ำฝนรั่วซึมเข้าทางห้องนอน ห้องนั่งเล่น น้ำฝนไหลซึมเข้ากรอบอลูลูมิเนียมหน้าต่างนั้น ขอสอบถามถึงระยะการรับประกันโครงสร้าง 5 ปี ของอาคารเพื่อให้ทางโครงการเข้ามาตรวจสอบและแก้ไขปัญหาดังกล่าว เบื้องต้นทางนิติฯได้ส่งเรื่องเคลมภายในห้องชุดกับทางประกันภัยอาคารไปแล้วค่ะ เหลือในส่วนของผนังด้านนอกที่มีรอยร้าวจากโครงการ รบกวนประสานกลับเพื่อแจ้งความคืบหน้าต่อเจ้าของร่วมต่อไปค่ะ                                                                                                                               ', '0000-00-00 00:00:00', '2021-05-27 11:48:04', '0000-00-00 00:00:00', '2021-06-07 15:09:51', '-รับเรื่องรอตรวจสอบ 27/5/64  เข้าตรวจสอบหน้างานวิศวกรเเจ้งว่า ผนังด้านนอกมีรอยร้าว เวลาฝนตกน้ำรั่วซึมเข้า ด้านในห้องทำให้พื้นเสียหายลูกบ้าน นิติแจ้งว่าเคยเคลมไปแล้ว และลูกบ้านเเก้ไขเองไปแล้ว 2 ครั้งแต่ก็ไม่หาย   ซึ่งจากการวิเคราะห์ เป็นอาคารด้านนอกอาคารอยู่ในความรับผิดชอบของนิติ 7/6/64', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('157', 'con1622090906', 'นิติบุคคลอาคารชุด ดิไอริส บางใหญ่', 'IBY', '3710', '0648975422', 'theirisbangyai.jlm@gmail.com', 'เรียน  เจ้าหน้าที่หลังการขาย                                                                                                                                                          \r\n        เนื่องจากผนังด้านนอกของอาคาร  3  ชั้น 7  ติดนห้องเจ้าของร่วม 127/144  ทางนิติฯได้ตรวจสอบสาเหตุพบว่าห้องชุดมีน้ำฝนรั่วซึมเข้าทางห้องนอน ห้องนั่งเล่น น้ำฝนไหลซึมเข้ากรอบอลูลูมิเนียมหน้าต่างนั้น ขอสอบถามถึงระยะการรับประกันโครงสร้าง 5 ปี ของอาคารเพื่อให้ทางโครงการเข้ามาตรวจสอบและแก้ไขปัญหาดังกล่าว เบื้องต้นทางนิติฯได้ส่งเรื่องเคลมภายในห้องชุดกับทางประกันภัยอาคารไปแล้วค่ะ เหลือในส่วนของผนังด้านนอกที่มีรอยร้าวจากโครงการ รบกวนประสานกลับเพื่อแจ้งความคืบหน้าต่อเจ้าของร่วมต่อไปค่ะ                                                                                                                               ', '0000-00-00 00:00:00', '2021-05-27 11:48:26', '0000-00-00 00:00:00', '2021-06-07 15:08:39', '-รับเรื่องรอตรวจสอบ 27/5/64  เข้าตรวจสอบหน้างาน วิศวกรเเจ้งว่า ผนังด้านนอกมีรอยร้าวทำให้เวาฝนตก น้ำรั่วซึมเข้ามาในห้องด้านในของลูกบ้าน   อาคารด้านนอกเป็นงานรับผิดชอบของทางนิติ  7/6/64 ', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('158', 'con1622115537', 'ธาตรี เรียมผา', 'IPC', '49/226', '0897715949', 'r.thatree@hotmail.com', 'มีน้ำไหลรั่วซึมตรงมุมห้องในห้องครัวด้านที่ติดกับห้องน้ำชั้นล่าง ไหลซึมตลอด สันนิษฐานว่ารั่วจากท่อน้ำใช้ แก้ไขเบื้องต้นคือดึงปลั๊กปั๊มน้ำออกน้ำจะหยุดรั่วซึม แต่ก้อมีปัญหาไม่มีน้ำใช้ในบ้าน ขอแจ้งให้ดำเนินการตรวจสอบแก้ไขด่วนหน่อยครับ', '0000-00-00 00:00:00', '2021-05-27 06:38:57', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '-', '', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
INSERT INTO tbl_defectlogs VALUES ('159', 'con1622877352', 'ดาราณี  ทองอินทร์', 'IPC', '49/19', '0951249545', 'maodaranee@gmail.com', '1.มีรอยร้าวภายในบ้านหลายจุด  เช่น\r\n   -หน้าต่างชั้นบนและประตูบานเลื่อนน้ำรั่วทุกบาน  \r\n   -ชั้นล่างประตูบานเลื่อนน้ำรั่วเข้ามาในบ้านเวลาฝนตก และ\r\n   -เชิงชายหลังคาร้าวหลายจุด และ นอกบ้านมีรอยร้าวเป็นบางจุด\r\n2.อุดปูนตรงรั้วหน้าบ้านตรง ตู้ ปณ.', '0000-00-00 00:00:00', '2021-06-05 02:15:52', '0000-00-00 00:00:00', '2021-06-07 15:12:53', 'วิศวกรเข้าตรวจสอบ 5/6/64', 'กนกพร  อุปการดี', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0', '0000-00-00 00:00:00', '0', '', '0', null);
